import React from "react";

/**
 * 模型图标加载器使用说明
 *
 * 作用
 * - 根据后端返回的图标名 `name` 返回对应的 SVG 组件 JSX；未匹配时回退到默认图标。
 *
 * 快速使用
 * - 在 JSX 中：`{getModelIcon('11f', 'w-4 h-4')}`
 * - 搭配后端字段：`{getModelIcon(opt.icon, 'w-4 h-4')}` 或 `{getModelIcon(data.icon, 'w-4 h-4')}`
 *
 * 样式
 * - 通过 `className` 控制尺寸与颜色，例如：`w-4 h-4`、`text-gray-700`
 * - 使用了 `currentColor` 的图标可用 `text-*` 颜色类生效
 *
 * 扩展映射
 * - 在下方 `map` 中为新图标名添加键，例如：
 *   `import { AiModelHailuoImageSvg } from './staticIcon'`
 *   `map['1ff'] = AiModelHailuoImageSvg as any`
 *
 * 注意
 * - 使用 `map[name] ?? map['default']` 在未匹配时使用默认图标
 * - 确保后端字段与 `map` 键一致（如后端返回的 `item.icon_name`）
 *
 * API
 * - `getModelIcon(name: string, className?: string): JSX.Element`
 */
export const getModelIcon = (name: string, className?: string) => {
  const map: Record<string, React.FC<{ className?: string }>> = {
    deepseek_v3_1: deepseek_v3_1 as any,
    claude_sonnet_4_5: claude_sonnet_4_5 as any,
    gemini_2_5_flash: gemini_2_5_flash_nano_banana_nano_banana_pro as any,
    nano_banana: gemini_2_5_flash_nano_banana_nano_banana_pro as any,
    nano_banana_pro: gemini_2_5_flash_nano_banana_nano_banana_pro as any,
    gpt_image_1: gpt_5_gpt_image_1 as any,
    seedream_4: seedream_4 as any,
    ideogram_3_0: ideogram_3_0 as any,
    flux_kontext_pro: flux_1_flux_kontext_pro_flux_1_1_pro as any,
    qwen_image_edit: qwen_image_edit as any,
    sora_2_pro: sora_2_pro_sora_2 as any,
    sora_2: sora_2_pro_sora_2 as any,
    veo_3_1: veo_3_1_veo_3_1_fast as any,
    veo_3_1_fast: veo_3_1_veo_3_1_fast as any,
    wan_2_5: wawan_2_5n as any,
    dreamina_3_pro: dreamina_3_0_pro as any,
    kling_2_5_pro: kling_2_5_pro_kling_kling_v1_tts_kling_sound as any,
    kling: kling_2_5_pro_kling_kling_v1_tts_kling_sound as any,
    sync_lipsync_2_0: sync_lipsync_2_0 as any,
    minimax_speech_2_hd: minimax_m2_minimax_speech_02_hd_minimax_music_02 as any,
    elevenlabs_turbo_2_5: elevenlabs_turbo_2_5 as any,
    kling_v1_tts: kling_2_5_pro_kling_kling_v1_tts_kling_sound as any,
    minimax_music_2: minimax_m2_minimax_speech_02_hd_minimax_music_02 as any,
    kling_sound: kling_2_5_pro_kling_kling_v1_tts_kling_sound as any,

    default: gemini_2_5_flash_nano_banana_nano_banana_pro as any,
  };

  const Comp = map[name] ?? map["default"];
  return <Comp className={className || ""} />;
};

/**
 * 模型图标 - claude_sonnet_4.5 16x16
 */
export const claude_sonnet_4_5: React.FC<{ className: string }> = ({ className }) => (
  <svg width={16} height={16} viewBox="0 0 16 16" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" className={className}>
    <image
      width={16}
      height={16}
      preserveAspectRatio="none"
      xlinkHref="data:image/png;base64,"
    />
  </svg>
);

